#iteration over input data
for index, row in data.iterrows():
    print(index)
    sequence = row['Sequence']
    #sequences with unnatural aminoacids (e.g. U or X) are removed
    sequence = remove_unnatural(sequence)
    try:
        sequence=sequence[0]
        id=row['Variant']
        #Tm=row['FIO_HG3.17']
        #protparam analysis of the sequence
        protparam=ProteinAnalysis(sequence)
        length=len(sequence)
        MW=protparam.molecular_weight()
        isoelectric_point=protparam.isoelectric_point()
        sec_structure=protparam.secondary_structure_fraction()
        helix=sec_structure[0]
        turn=sec_structure[1]
        sheet=sec_structure[2]
        charge=protparam.charge_at_pH(7.0)
        aminoacids=protparam.get_amino_acids_percent()
        A=aminoacids['A']
        C=aminoacids['C']
        D=aminoacids['D']
        E=aminoacids['E']
        F=aminoacids['F']
        G=aminoacids['G']
        H=aminoacids['H']
        I=aminoacids['I']
        K=aminoacids['K']
        L=aminoacids['L']
        M=aminoacids['M']
        N=aminoacids['N']
        P=aminoacids['P']
        Q=aminoacids['Q']
        R=aminoacids['R']
        S=aminoacids['S']
        T=aminoacids['T']
        V=aminoacids['V']
        W=aminoacids['W']
        Y=aminoacids['Y']
        hydrophobic=A+F+I+L+M+V+W
        positiv=K+R
        negativ=D+E
        hydropathicityscale=protparam.protein_scale(hydropathicity,5,0.4)
        gravy=sum(hydropathicityscale)/length
        flexibilityscale=protparam.protein_scale(flexibility,5,0.4)
        flexy=sum(flexibilityscale)/length
        codonscale=protparam.protein_scale(number_codons,5,0.4)
        cody=sum(codonscale)/length
        polarityscale=protparam.protein_scale(polarity,5,0.4)
        polary=sum(polarityscale)/length    
        transmembranscale=protparam.protein_scale(transmembrane_tendency,5,0.4)
        transmemby=sum(transmembranscale)/length 
        ent = entropy(sequence)
        #storing protparam features in list
        list_features=[id,length,MW,isoelectric_point,helix,turn,sheet,charge,gravy,flexy,cody,polary,transmemby,A,C,D,E,F,G,H,I,K,L,M,N,P,Q,R,S,T,V,W,Y,hydrophobic,positiv,negativ,ent]
       #protlearn feature generation and extending of protparam list
        aaind, inds = aaindex1(sequence, standardize='zscore')
        list_features.extend(aaind[0])
        di, ngrams = ngram(sequence, n=2)
        list_features.extend(di[0])
        tri, ngrams = ngram(sequence, n=3)
        list_features.extend(tri[0])    
        atoms, bonds = atc(sequence)
        list_features.extend(atoms[0])
        list_features.extend(bonds[0])
        ctd_arr, ctd_desc = ctd(sequence)
        list_features.extend(ctd_arr[0])
        paac_comp, desc = paac(sequence, lambda_=3, remove_zero_cols=False)
        list_features.extend(paac_comp[0])
        apaac_comp, desc = apaac(sequence, lambda_=3, remove_zero_cols=False)
        list_features.extend(apaac_comp[0])
        d, desc = ctdd(sequence)
        list_features.extend(d[0])
        sw, g = socn(sequence, d=3)
        list_features.extend(sw[0])
        list_features.extend(g[0])
        sw2, g, desc = qso(sequence, d=3, remove_zero_cols=False)
        list_features.extend(sw2[0])
        list_features.extend(g[0])
        #append feature csv by one row made of protparam+protlearn list
        df_features=pd.DataFrame([list_features])
        df_features.to_csv('features_validation_round_2.csv',sep=';', mode='a', header=False, index=False)
    except:
        print(f"Skipped {index}")
        pass
